import React from "react";
import "../styles/index.css";
import "../styles/signUp.css";
import "../styles/login.css";
import loginBackground from "../imgs/loginBackground.jpg";
import { Link } from "react-router-dom";
const Login = () => {
  return (
    <>
      <div class="loginForm">
        <div class="form-ele1">
          <h1 id="heading">Login</h1>
          <div class="form-ele2" id="signUpform">
            <form>
              <label>User Name</label>
              <br />
              <div class="form-style">
                <input class=" h-12" type="text" name="un" />
              </div>
              <br />
              <label>Password</label>
              <br />
              <div class="form-style">
                <input class=" h-12" type="password" name="pw" />
              </div>
              <br />
              <br />
              <div id="link">
                <Link to="/forgot">forgot your password?</Link>
              </div>
              <button class="w-32 h-16 formButton" type="submit">
                Login
              </button>
            </form>
          </div>
        </div>
      </div>
      <img src={loginBackground} />
    </>
  );
};

export default Login;
